import React, {Component} from 'react';

import Cards from "./cards/cards";


class Questions extends Component {
    handleGenerate;

    constructor(props) {
        super(props);
        this.state = {
            questions: ''
        }
    };



    render() {

        window.addEventListener('load', () => {
            console.log('ok');
            let questionNumber = [];
            for (let i = 1; i > 20; i++) {
                console.log('OH')
                questionNumber.push(i);
                console.log(questionNumber)
            }
        });

        return (
            <section>
                <Cards/>
            </section>
        )
    }
}

export default Questions;
